import React, { useState } from 'react';
import axios from 'axios';

const PredictForm = () => {
  const [formData, setFormData] = useState({
    dense_2_input: [0, 0, 0, 0],
  });

  const handleChange = (e, index) => {
    const { value, name } = e.target;
    const updatedValues = [...formData[name]];
    updatedValues[index] = parseFloat(value);
    setFormData({ ...formData, [name]: updatedValues });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const result = await axios.post('http://localhost:8000/predict/iris_model', formData, {
        headers: {
          'Content-Type': 'application/json',
        },
      });
      console.log("Response data:", result.data);
      // İşlem başarılı
    } catch (error) {
      console.log("Error details:", error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h1>Enter Data for Prediction</h1>
      <div>
        <label>Sepal Length:</label>
        <input
          type="number"
          value={formData.dense_2_input[0]}
          onChange={(e) => handleChange(e, 0)}
        />
      </div>
      <div>
        <label>Feature 2:</label>
        <input
          type="number"
          value={formData.dense_2_input[1]}
          onChange={(e) => handleChange(e, 1)}
        />
      </div>
      <div>
        <label>Feature 3:</label>
        <input
          type="number"
          value={formData.dense_2_input[2]}
          onChange={(e) => handleChange(e, 2)}
        />
      </div>
      <div>
        <label>Feature 4:</label>
        <input
          type="number"
          value={formData.dense_2_input[3]}
          onChange={(e) => handleChange(e, 3)}
        />
      </div>
      <button type="submit">Submit</button>
    </form>
  );
};

export default PredictForm;
